import React from 'react';
class NavPage extends React.Component {
    constructor(props){
        super(props);
        this.state = {
        isLoading: true, 
        data: []
        }
    }  

    componentDidMount() {
        fetch('https://cors-anywhere.herokuapp.com/https://api.twitter.com/2/tweets/1516462885291057153')
        .then((response) => response.json())
        .then((responseJson) => {
            this.setState({data: responseJson.data, isLoading: false});
        })
        .catch((error) => {
          console.error(error);
        });

    }
    render(){
        return (<div className="section-nav">
        <ul>
          <li><a href="https://stackoverflow.com">Stack Overflow</a></li>
        </ul>
        <div>
        {this.state.data.map(item => <div>{item.text}</div>)}
        </div>
        </div>) ; 

    }
}
export default NavPage;
